import classes from "./all.module.css";
import React from "react";
import {NavLink} from "react-router-dom";

function Header() {
    return (
        <div >
            <nav >
                <div className={`container ${classes.container} ${classes.nav}`}>
                    <NavLink className={`${classes.links} ${classes.l}`} to="/">
                        List of books
                    </NavLink>
                    <NavLink className={`${classes.links} ${classes.l}`} to="/about">
                        About project
                    </NavLink>
                </div>
            </nav>
        </div>
    );
}

export default Header;
